import React, { Component } from 'react'
import Kletka from './Kletka/Kletka';
// import Cards from '././Card/card';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';

function FormRow() {
  //столбцы
    return (
      <React.Fragment>
        <Grid item xs={2}>
          <Paper ><Kletka /></Paper>
        </Grid>
        <Grid item xs={2}>
          <Paper ><Kletka /></Paper>
        </Grid>
        <Grid item xs={2}>
          <Paper ><Kletka /></Paper>
        </Grid>
        <Grid item xs={2}>
          <Paper ><Kletka /></Paper>
        </Grid>
      </React.Fragment>
    );
  }

export default class Pole extends Component {
// строки
    render() {
        return (
            <>
            <Grid container spacing={0}>
        <Grid container item xs={12} spacing={0}>
          <FormRow />
        </Grid>
        <Grid container item xs={7} spacing={0}>
          <FormRow />
        </Grid>
        <Grid container item xs={10} spacing={0}>
          <FormRow />
        </Grid>
      </Grid>

            </>
        )
    }
}
